function initMap() {
  // The location of Uluru
  var uluru = {
    lat: 40.179694,
    lng: 44.514234
  };
  var locations = {
    operaHouse: {
      lat: 40.169208,
      lng: 44.513450
    },
    tarongaZoo: {
      lat: 40.179694,
      lng: 44.514234
    },
    manlyBeach: {
      lat: 40.170266,
      lng: 44.489019
    },
    hyderPark: {
      lat: 40.176317,
      lng: 44.631250
    },
    theRocks: {
      lat: 40.220603,
      lng: 44.504305
    },
    circularQuay: {
      lat: 40.285746,
      lng: 44.480304
    },
    harbourBridge: {
      lat: 39.970228,
      lng: 44.501698
    },
    kingsCross: {
      lat: 40.188922,
      lng: 44.613693
    }
  }; // The map, centered at Uluru

  var map = new google.maps.Map(document.getElementById("map"), {
    zoom: 8,
    center: uluru
  });
  var markers = [];

  for (var location in locations) {
    var markerOptions = {
      // The marker, positioned at Uluru
      // const marker = new google.maps.Marker({
      position: locations[location],
      map: map
    };
    var marker = new google.maps.Marker(markerOptions);
    markers.push(marker);
  }

  return markers;
}

window.initMap = initMap; //
